-- Table structure for `ghtweb_users`
-- ----------------------------
DROP TABLE IF EXISTS `ghtweb_users`;
CREATE TABLE `ghtweb_users` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `login` varchar(20) NOT NULL,
  `password` char(32) NOT NULL,
  `email` varchar(128) NOT NULL,
  `activated` tinyint(1) NOT NULL DEFAULT '1',
  `activated_hash` char(32) DEFAULT NULL,
  `activated_hash_time` datetime DEFAULT NULL COMMENT 'Время через которое ссылка по активации аккаунта сдохнет',
  `cookie_hash` char(32) DEFAULT NULL,
  `banned` tinyint(1) NOT NULL DEFAULT '0',
  `banned_reason` text,
  `antibrut_blocked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1 - заблокирована, 0 - нет',
  `antibrut_blocked_time` datetime DEFAULT NULL COMMENT 'Время блокировки аккаунта во время брута',
  `protected_ip` varchar(255) DEFAULT NULL,
  `last_ip` varchar(20) DEFAULT NULL,
  `last_login` datetime DEFAULT NULL COMMENT 'Последний раз авторизовывался',
  `group` tinyint(4) NOT NULL DEFAULT '2',
  `last_access` datetime NOT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`user_id`),
  KEY `ixUser_id` (`user_id`),
  KEY `ixLogin` (`login`),
  KEY `ixCookie_hash` (`cookie_hash`)
